function Icon({
  children,
  className,
  fill = 'currentColor',
  stroke,
  viewBox,
  ...props
}) {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox={viewBox ? viewBox : '0 0 20 20'}
      {...props}
      fill={fill}
      stroke={stroke}
      aria-hidden="true"
      focusable="false"
      className={clsx(
        className?.includes('w-') ? '' : 'w-4',
        className?.includes('h-') ? '' : 'h-4',
        className,
      )}
    >
      {children}
    </svg>
  );
}

